var variantList = [];
var windowSize = [0, 0];
var dragOn = false;
var dragSide = 0;
var maxCov = 0;
var maxQual = 0;

function readVCF(evt) {

	variantList = [];
	var file = evt.target.files[0];
	var reader = new FileReader();
	reader.onload = function() {
		var lines = reader.result.split(/[\r\n]+/g);
		for (i = 1; i < lines.length; i ++) {
			var pieces = lines[i].split('\t');
			var c = "";
			if (pieces[0].length == 5) {
				c = pieces[0].charAt(3) + pieces[0].charAt(4);
			}
			else {
				c = pieces[0].charAt(3);
			}
			variantList.push( { chr:parseInt(c), pos:parseInt(pieces[1]), refN:pieces[2], varN:pieces[3], freq:parseFloat(pieces[4]), qual:parseFloat(pieces[5]), geneID:pieces[6], cov:parseInt(pieces[7]), strandBias:parseFloat(pieces[9]), name:pieces[10] } );

			if (parseInt(pieces[7]) > maxCov) {
				maxCov = parseInt(pieces[7]);
			}		
			if (parseInt(pieces[5]) > maxQual) {
				maxQual = parseInt(pieces[5]);
			} 
		}

		var x = document.getElementById('covRange');
		var y = document.getElementById('covText');
		x.max = maxCov;
		x.value = 100;
		y.value = 100;

		x = document.getElementById('qualRange');
		y = document.getElementById('qualText');
		x.max = maxQual;
		x.value = 30;
		y.value = 30;

		draw(0);
	};
	reader.readAsText(file);

}

function setupCanvas() {

	var canvas = document.getElementById("mainTrack");
	var ctx = canvas.getContext("2d");
	ctx.fillStyle = "#FFFFFF";
	ctx.strokeStyle = "#000000";
	ctx.strokeRect(0, 0, 1000, 200);
	ctx.font = "30px Arial";
	ctx.fillStyle = "#000000";
	ctx.fillText("No Data", 20, 100);
}

function update(evt) {

	var x = parseInt(evt.target.value);
	if (x != 0) {
		windowSize = [0, lref[x]];
	}
	draw(x);

}

function draw(mode) {

	var zGenes = document.getElementById("zoomGT");
	var zgctx = zGenes.getContext("2d");
	zgctx.clearRect(0, 0, zGenes.width, zGenes.height);
	zgctx.fillStyle = "#FFFFFF";
	zgctx.strokeStyle = "#000000";

	var zoom = document.getElementById("zoomTrack");
	var zctx = zoom.getContext("2d");
	zctx.clearRect(0, 0, zoom.width, zoom.height);
	zctx.fillStyle = "#FFFFFF";
	zctx.strokeStyle = "#000000";

	var genes = document.getElementById("geneTracks");
	var gctx = genes.getContext("2d");
	gctx.clearRect(0, 0, genes.width, genes.height);
	gctx.strokeStyle = "#000000";
	gctx.fillStyle = "#000000";
	
	var canvas = document.getElementById("mainTrack");
	var ctx = canvas.getContext("2d");
	ctx.clearRect(0, 0, canvas.width, canvas.height);
	ctx.font = "30px Arial";
	ctx.fillStyle = "#FFFFFF";
	ctx.strokeStyle = "#000000";
	ctx.strokeRect(0, 0, 1000, 200);

	var cover = document.getElementById('covTrack');
	var covCtx = cover.getContext('2d');
	covCtx.clearRect(0, 0, cover.width, cover.height);
	covCtx.strokeStyle = "#000000";
	covCtx.fillStyle = "#FFFFFF";

	var freq = document.getElementById('freqTrack');
	var freqCtx = freq.getContext('2d');
	freqCtx.clearRect(0, 0, freq.width, freq.height);
	freqCtx.strokeStyle = "#000000";
	freqCtx.fillStyle = "#FFFFFF";

	var qual = document.getElementById('qualTrack');
	var qualCtx = qual.getContext('2d');
	qualCtx.clearRect(0, 0, qual.width, qual.height);
	qualCtx.strokeStyle = "#000000";
	qualCtx.fillStyle = "#FFFFFF";

	var bias = document.getElementById('biasTrack');
	var biasCtx = bias.getContext('2d');
	biasCtx.clearRect(0, 0, bias.width, bias.height);
	biasCtx.strokeStyle = "#000000";
	biasCtx.fillStyle = "#FFFFFF";


	if (mode == 0) {
		ctx.fillStyle = "#000000";
		ctx.fillText("There are " + variantList.length + " variants.", 20, 100);
	}
	else {
		zctx.strokeRect(0, 0, 500, 50);
		zctx.fillStyle = "#777777";
		zctx.strokeStyle = "#777777";
		zctx.fillRect(windowSize[0]/lref[mode] * 500, 0, (windowSize[1] - windowSize[0])/lref[mode] * 500, 50);

		ctx.strokeStyle = "#FF0000";
		for (i = 0; i < variantList.length; i ++) {
			if (variantList[i].chr == mode) {
				var v = variantList[i];
				var c = v.chr;
				var posX = (v.pos/lref[c]) * 500;
				zctx.strokeStyle = "#FF0000";
				zctx.beginPath();
				zctx.moveTo(posX, 0);
				zctx.lineTo(posX, 50);
				zctx.stroke();

				posX = (v.pos - windowSize[0])/(windowSize[1] - windowSize[0]) * 1000;
				if (v.pos >= windowSize[0] && v.pos <= windowSize[1]) {
					ctx.beginPath();
					ctx.moveTo(posX, 0);
					ctx.lineTo(posX, 200);
					ctx.stroke();

					covCtx.strokeStyle = "#FF0000";
					covCtx.beginPath();
					covCtx.moveTo(posX, 50);
					covCtx.lineTo(posX, (1 - v.cov/maxCov) * 50);
					covCtx.stroke();

					freqCtx.strokeStyle = "#FF0000";
					freqCtx.beginPath();
					freqCtx.moveTo(posX, 50);
					freqCtx.lineTo(posX, (1 - v.freq/100) * 50);
					freqCtx.stroke();

					qualCtx.strokeStyle = "#FF0000";
					qualCtx.beginPath();
					qualCtx.moveTo(posX, 50);
					qualCtx.lineTo(posX, (1 - v.qual/maxQual) * 50);
					qualCtx.stroke();

					biasCtx.strokeStyle = "#FF0000";
					biasCtx.beginPath();
					biasCtx.moveTo(posX, 50);
					biasCtx.lineTo(posX, (1 - v.strandBias) * 50);
					biasCtx.stroke();
				}
			}
		}

		gctx.beginPath();
		gctx.moveTo(0, 5);
		gctx.lineTo(1000, 5);
		gctx.stroke();
		zgctx.beginPath();
		zgctx.moveTo(0, 5);
		zgctx.lineTo(500, 5);
		zgctx.stroke();
		for (i = 0; i < geneList.length; i ++) {
			if (geneList[i].chr == mode) {
				if (!(geneList[i].startPos > windowSize[1] || geneList[i].endPos < windowSize[0])) {
					gctx.strokeRect((geneList[i].startPos - windowSize[0])/(windowSize[1] - windowSize[0]) * 1000, 0, (geneList[i].endPos - geneList[i].startPos)/lref[mode] * 1000, 10);
				}
				zgctx.strokeRect(geneList[i].startPos/lref[mode] * 500, 0, (geneList[i].endPos - geneList[i].startPos)/lref[mode] * 500, 10);
			}
		}

	document.getElementById('start').value = windowSize[0];
	document.getElementById('end').value = windowSize[1];

	var covTemp = document.getElementById('covRange').value;
	var freqTemp = document.getElementById('freqRange').value;
	var qualTemp = document.getElementById('qualRange').value;
	var biasTemp = document.getElementById('biasRange').value;

	covCtx.strokeStyle = "#000000";
	covCtx.strokeRect(0, 0, 1000, 50);
	covCtx.beginPath();
	covCtx.moveTo(0, (1 - covTemp/maxCov) * 50);
	covCtx.lineTo(1000, (1 - covTemp/maxCov) * 50);
	covCtx.stroke();

	freqCtx.strokeStyle = "#000000";
	freqCtx.strokeRect(0, 0, 1000, 50);
	freqCtx.beginPath();
	freqCtx.moveTo(0, (1 - freqTemp/100) * 50);
	freqCtx.lineTo(1000, (1 - freqTemp/100) * 50);
	freqCtx.stroke();

	qualCtx.strokeStyle = "#000000";
	qualCtx.strokeRect(0, 0, 1000, 50);
	qualCtx.beginPath();
	qualCtx.moveTo(0, (1 - qualTemp/maxQual) * 50);
	qualCtx.lineTo(1000, (1 - qualTemp/maxQual) * 50);
	qualCtx.stroke();

	biasCtx.strokeStyle = "#000000";
	biasCtx.strokeRect(0, 0, 1000, 50);
	biasCtx.beginPath();
	biasCtx.moveTo(0, (1 - biasTemp) * 50);
	biasCtx.lineTo(1000, (1 - biasTemp) * 50);
	biasCtx.stroke();

	}

}

function mousePressed(evt) {

	dragOn = true;
	var n = document.getElementById('chromMode').value;
	if (n != 0) {
		var mouseX = Math.round((evt.clientX - 250)/500 * lref[n]);
		if (Math.abs(mouseX - windowSize[0]) > Math.abs(mouseX - windowSize[1])) {
			dragSide = 1;
		}
		else {
			dragSide = 0;
		}
	}

}

function mouseDragged(evt) {

	if (dragOn) {
		var n = document.getElementById('chromMode').value;
		if (n != 0) {
			var mouseX = Math.round((evt.clientX - 250)/500 * lref[n]);
			windowSize[dragSide] = mouseX;
			draw(n);
		}
	}

}

function mouseReleased(evt) {

	dragOn = false;
	var n = document.getElementById('chromMode').value;
	if (n != 0) {
		var mouseX = Math.round((evt.clientX - 250)/500 * lref[n]);
		windowSize[dragSide] = mouseX;
		draw(n);
	}

}

function mouseLeft(evt) {

	if (dragOn) {
		dragOn = false;
		var n = document.getElementById('chromMode').value;
		if (n != 0) {
			windowSize[dragSide] = dragSide * lref[n];
			draw(n);
		}

	}

}

function changeWindowStart(evt) {
	windowSize[0] = parseInt(evt.target.value);
	var n = document.getElementById('chromMode').value;
	if (windowSize[0] < 0) {
		windowSize[0] = 0;
	}
	if (windowSize[0] > lref[n]) {
		windowSize[0] = lref[n];
	}
	draw(n);
}

function changeWindowEnd(evt) {
	windowSize[1] = parseInt(evt.target.value);
	var n = document.getElementById('chromMode').value;
	if (windowSize[1] < 0) {
		windowSize[1] = 0;
	}
	if (windowSize[1] > lref[n]) {
		windowSize[1] = lref[n];
	}
	draw(n);
}

function updateText(evt) {

	var n = evt.target.id;
	if (n == 'covRange') {
		document.getElementById('covText').value = evt.target.value;
	}
	else if (n == 'freqRange') {
		document.getElementById('freqText').value = evt.target.value;
	}
	else if (n == 'qualRange') {
		document.getElementById('qualText').value = evt.target.value;
	}
	else {
		document.getElementById('biasText').value = evt.target.value;
	}

	n = document.getElementById('chromMode').value;
	draw(n);

}

function updateRange(evt) {

	var n = evt.target.id;
	if (n == 'covText') {
		document.getElementById('covRange').value = evt.target.value;
	}
	else if (n == 'freqText') {
		document.getElementById('freqRange').value = evt.target.value;
	}
	else if (n == 'qualText') {
		document.getElementById('qualRange').value = evt.target.value;
	}
	else {
		document.getElementById('biasRange').value = evt.target.value;
	}

	n = document.getElementById('chromMode').value;
	draw(n);

}


